// ------------------ Chat Local ------------------
const chatBox=document.getElementById('chatBox');
const chatInput=document.getElementById('chatInput');
const chatSend=document.getElementById('chatSend');
const chatClear=document.getElementById('chatClear');
function addMsg(txt, cls){
  const d=document.createElement('div'); d.className='msg '+cls; d.textContent=txt; chatBox.appendChild(d); chatBox.scrollTop=chatBox.scrollHeight;
}
function botReply(msg){
  const m=msg.toLowerCase();
  if(m.includes('oi')||m.includes('ola')||m.includes('olá')) return 'Oi! Como posso ajudar?';
  if(m.includes('loja')||m.includes('preço')) return 'Use a aba LOJA para ver produtos e adicionar ao carrinho.';
  if(m.includes('quiz')) return 'O quiz tem 50 perguntas. Clique em Próxima para avançar.';
  if(m.includes('cobra')||m.includes('jogo')) return 'Na cobrinha, use as setas/WASD ou o direcional na tela.';
  if(m.includes('hist')) return 'A seção HISTÓRIA tem uma linha do tempo com marcos principais.';
  if(m.includes('limpar')) return 'Clique em "Limpar" para apagar o histórico local.';
  return 'Não entendi. Tente perguntar sobre: loja, quiz, jogo, história ou limpar.';
}
chatSend.onclick=()=>{
  const v=chatInput.value.trim(); if(!v) return; addMsg(v,'me'); chatInput.value='';
  setTimeout(()=>addMsg(botReply(v),'bot'), 300);
};
chatInput.addEventListener('keydown', e=>{ if(e.key==='Enter') chatSend.click(); });
chatClear.onclick=()=>{ chatBox.innerHTML=''; };

